import React from 'react';
import {Link} from 'react-router-dom';

const Menu=()=>{
    return(
        <div>
            <ul>
                <li><Link to = "/">홈</Link></li>
                <li><Link to = "/about">소개</Link></li>
                <li><Link to = "/about/react">React 소개</Link></li>
            </ul>
        </div>
    )
}
export default Menu;
